import React, { useState } from 'react';
import { Container, Row, Col, Button, Collapse } from 'react-bootstrap';
import '../styleesheets/Dashboard.css';
import ListadoVehiculos from './vehiculos/ListadoVehiculos';

function Varios() {
    const [open, setOpen] = useState(false);

    const handleClick = () => {
       setOpen(!open);
    };
    return (
        <main>
            <Container>
                <Row>
                    <Col>
                        <h3><span className='fa fa-wrench'></span>&nbsp;Parametrías Varias</h3>
                    </Col>
                    <Col>
                        <button className='btn-agregar'><span className='fa fa-plus-square'></span>&nbsp;Nuevo</button>
                    </Col>
                </Row>
                <Row>
                    <Col>
                        <Button onClick={handleClick} variant="primary">
                            {open ? 'Ocultar' : 'Mostrar'} opciones
                        </Button>
                    </Col>
                </Row>
                <Row>
                    <Col>
                        <Collapse in={open}>
                            <div>
                                <h3>Marcas</h3>
                                {/* Aquí puedes agregar la lista de marcas */}
                            </div>
                            <div>
                                <h3>Modelos</h3>
                                {/* Aquí puedes agregar la lista de modelos */}
                            </div>
                            <div>
                                <h3>Tipos Insumos</h3>
                                {/* Aquí puedes agregar la lista de tipos de insumos */}
                            </div>
                        </Collapse>
                    </Col>
                </Row>
            </Container>
        </main>
    );
}

export default Varios;
